const TranslationString AppStrings::emergency_button_instructions = TranslationString("\u2022 Please unplug charging cable from vehicle.<br>\u2022 Please check general condition of the charging station.<br>\u2022 If you see any problems, please contact service.<br>\u2022 If you don't see any abnormality, you can release emergency button by turning it clockwise.","\u2022 Lütfen şarj kablosunu aracınızdan sökünüz.<br>\u2022 Lütfen istasyon'un genel durumunu kontrol ediniz.<br>\u2022 Eğer bir problem görürseniz lütfen servis'e haber veriniz.<br>\u2022 Eğer normal olmayan bir durum görmüyorsanız acil durum butonunu saat yönünde çevirebilirsiniz.","\u2022נתק את כבל הטעינה מהרכב.<br>\u2022אם אתה נתקל בבעיה, צור קשר עם שרות לקוחות.<br>\u2022אם אתה לא מבחין בחריגה כלשהי, ניתן לשחרר את כפתור החירום על ידי סיבוב הלחן בכיוון השעון.","\u2022 Odpojte nabíjecí kabel z vozidla.<br>\u2022 Zkontrolujte celkový stav nabíjecí stanice.<br>\u2022 V případě jakýchkoliv problémů, kontaktujte službu.<br>\u2022 Pokud jste nezjistili žádné problémy, můžete nouzové tlačítko uvolnit otočením ve směru hodinových ručiček.","\u2022 Afbryd ladekablet fra køretøjet.<br>\u2022 Kontroller ladestationens generelle tilstand.<br>\u2022 Kontakt Service, hvis du ser nogen problemer.<br>\u2022 Hvis du ikke ser noget unormalt, kan du frigive nødstopknappen ved at dreje den mod uret.","\u2022 Bitte Ladekabel vom Fahrzeug trennen.<br>\u2022 Bitte Allgemeinzustand der Ladestation prüfen.<br>\u2022 Bei Problemen wenden Sie sich bitte an den Service.<br>\u2022 Wenn Sie keine Anomalie feststellen, können Sie den Notrufknopf durch Drehen im Uhrzeigersinn freigeben.","\u2022 Por favor, desconecte el cable de carga del vehículo.<br>\u2022 Por favor, revise el estado general de la estación de carga.<br>\u2022 Si observa algún problema, por favor, contacte con el servicio técnico.Si no observa ninguna anomalía, puede soltar el botón de emergencia girándolo en sentido horario.","\u2022 Irrota latauskaapeli ajoneuvosta.<br>\u2022 Tarkasta latausaseman yleiskunto.<br>\u2022 Jos ongelmia esiintyy, ota yhteys huoltoon.<br>\u2022 Jos epätavallisuuksia ei esiinny, vapauta hätäpysäytyspainike kiertämällä sitä myötäpäivään.","\u2022 Veuillez débrancher le câble de charge du véhicule.<br>\u2022 Veuillez vérifier l'état général de la station de charge.<br>\u2022 Si vous constatez des problèmes, veuillez contacter le service.<br>\u2022 Si vous ne voyez aucune anomalie, vous pouvez relâcher le bouton d'urgence en le tournant dans le sens horaire.","\u2022 Kérjük, válassza le a töltőkábelt az autóról.<br>\u2022 Kérjük, ellenőrizze a töltőállomás általános állapotát.<br>\u2022 Ha bármilyen problémát lát, keresse fel a szervizt.<br>\u2022 Ha nem található semmilyen rendellenesség, feloldhatja a vészleállító gombot úgy, hogy elforgatja jobbra.","\u2022 Per favore, scollega il cavo di ricarica dal veicolo.<br>\u2022 Per favore, controlla le condizioni generali della stazione di ricarica.<br>\u2022 Se noti qualche problema, per favore contatta l’assistenza.<br>\u2022 Se non noti nessuna anomalia, puoi rilasciare il pulsante di emergenza girandolo in senso orario.","\u2022 Koble ladekabelen fra kjøretøyet.<br>\u2022 Sjekk ladestasjonens generelle tilstand.<br>\ u2022 Hvis du ser noen problemer, kan du kontakte service.<br>\u2022 Hvis du ikke oppdager unormalitet, kan du slippe nødknappen ved å vri den med klokken.","\u2022 Odłącz przewód ładowania od pojazdu.<br>\u2022 Zapoznaj się z ogólnymi warunkami stacji ładowania.<br>\u2022 W przypadku zauważenia jakichkolwiek problemów, skontaktuj się z obsługą.<br>\u2022 Jeśli nie zauważysz nieprawidłowości, możesz zwolnić przycisk alarmowy, przekręcając go w prawo.","\u2022 Vă rugăm decuplați cablul de încărcare de la vehicul.<br>\u2022 Vă rugăm verificați condiția generală a stației de încărcare.<br>\u2022 Dacă observați orice problemă, vă rugăm contactați unitatea de service.<br>\u2022 Dacă nu observați nici o anomalie, puteți elibera butonul de urgență prin rotirea sa în sensul acelor de ceasornic.","\u2022 Odpojte nabíjací kábel z vozidla.<br>\u2022 Skontrolujte celkový stav nabíjacej stanice.<br>\u2022 V prípade akýchkoľvek problémov, kontaktujte službu.<br>\u2022 Ak ste nezistili žiadne problémy, môžete núdzové tlačidlo uvoľniť otočením v smere hodinových ručičiek.","\u2022 Koppla ur laddningskabeln ur fordonet.<br>\u2022 Kontrollera laddningsstationens funktion.<br>\u2022 Om problem hittas, kontakta service.<br>\u2022 om inga problem finns, frigör nödknappen genom att vrida den medsols.");
